// Sidebar.jsx

import React, { useState } from "react";
import CollapsibleMenu from "./CollapsibleMenu";

const Sidebar = ({ onMenuClick }) => {
  return (
    <div className="sidebar">
      <CollapsibleMenu title="Reports" onMenuClick={onMenuClick}>
        <div onClick={() => onMenuClick("LocalInspection")}>
          Local Inspection
        </div>
        <div onClick={() => onMenuClick("ClassBCDL")}>Class B CDL</div>
        <div onClick={() => onMenuClick("DamageReport")}>Damage Report</div>
      </CollapsibleMenu>
      <CollapsibleMenu title="Overview" onMenuClick={onMenuClick}>
        <div onClick={() => onMenuClick("Vehicles")}>Vehicles</div>
        <div onClick={() => onMenuClick("Equipment")}>Equipment</div>
        <div onClick={() => onMenuClick("Employees")}>Employees</div>
        <div onClick={() => onMenuClick("DamageReports")}>Damage Reports</div>
      </CollapsibleMenu>
    </div>
  );
};

export default Sidebar;
